import { NavLink } from 'react-router-dom';
import { useState, useEffect } from 'react';
import  classes from './HomePage.module.css';
import Branches from './Branches';
import backgroundImage from '../assets/logo.png'; // Import the image in JS

function HomePage() {
    const [branches, setBranches] = useState([]); // State to hold branch names

    useEffect(() => {
        const fetchBranches = async () => {
      try {
        const response = await fetch('http://localhost:5000/branches'); // Adjust your endpoint
        const data = await response.json();
        console.log(data.branches);

        setBranches(data.branches); // Assuming data is an array of branch names
      } catch (error) {
        console.error('Error fetching branches:', error);
      }
    };
       // fetchBranches();
    }, []);

  return (<>
<div
                style={{
                    backgroundImage: `url(${backgroundImage})`,
                    backgroundPosition: 'center', // Centers the image
                    backgroundSize: 'contain', // Maintains aspect ratio
                    backgroundRepeat: 'no-repeat',
                    height: '100vh', // Full screen height
                    width: '100vw',  // Full screen width
                    position: 'relative',
                    zIndex: 0, // Ensure the background stays behind
                }}
            >
                <div
                    style={{
                        position: 'absolute',
                        top: 0,
                        left: 0,
                        width: '100%',
                        height: '100%',
                        backgroundColor: 'rgba(255, 255, 255, 0.8)', // Semi-transparent overlay
                        zIndex: 1, // Place the overlay behind the content
                    }}
                ></div>

                <div
                    style={{
                        position: 'relative',
                        zIndex: 2, // Content in front of the overlay
                        color: 'black', // Ensure text is visible
                    }}
                >
                    <Branches />
                </div>
            </div>
  </>);
}

export default HomePage;
